package com.hose.mall.search;import java.io.Serializable;/** * 协议酒店关联 * @author wangmi wangmi@hosecloud.com */public class ProtocolMappingVo implements Serializable {    private static final long serialVersionUID = 5857982912990716509L;    public ProtocolMappingVo() {        super();    }    /**     * 自增ID     */    private Long id;    /**     * 酒店编号     */    private String hotelNo;    /**     * 客户编号     */    private String customerId;    /**     * 状态     */    private Boolean dataStatus;    public Long getId() {        return this.id;    }    public void setId(Long id) {        this.id = id;    }    public String getHotelNo() {        return this.hotelNo;    }    public void setHotelNo(String hotelNo) {        this.hotelNo = hotelNo;    }    public String getCustomerId() {        return this.customerId;    }    public void setCustomerId(String customerId) {        this.customerId = customerId;    }    public Boolean getDataStatus() {        return this.dataStatus;    }    public void setDataStatus(Boolean dataStatus) {        this.dataStatus = dataStatus;    }    @Override    public String toString() {        return "{\"id\":" + this.id + ",\"hotelNo\":\"" + this.hotelNo + "\",\"customerId\":\"" + this.customerId + "\",\"dataStatus\":" + this.dataStatus + "}";    }}